uint8_t fletcher8(const void *buffer, size_t size)
{
	const uint8_t *data = buffer;
	uint8_t sum[2] = {0};

	for (int i = 0; i < size; i++) {
		sum[0] = (sum[0] + *data++) % 0xF;
		sum[1] = (sum[1] +  sum[0]) % 0xF;
	}

	return sum[1] << 4 | sum[0];
}

uint16_t fletcher16(const void *buffer, size_t size)
{
	const uint8_t *data = buffer;
	uint8_t sum[2] = {0};

	for (int i = 0; i < size; i++) {
		sum[0] = (sum[0] + *data++) % 0xFF;
		sum[1] = (sum[1] +  sum[0]) % 0xFF;
	}

	return sum[1] << 8 | sum[0];
}

bool is_datel_disc(const DiskHeader *header)
{
	return !memcmp(header, &DATEL, offsetof(DiskHeader, DVDMagicWord));
}

bool is_diag_disc(const DiskHeader *header)
{
	if (!memcmp(header, &NDDEMO, offsetof(DiskHeader, DVDMagicWord)) &&
		!strcmp(header->GameName, "NDDEMO")) return false;

	return isdigit(header->ConsoleID) && header->MakerCodeA == '0' && header->MakerCodeB == '1';
}

bool is_multi_disc(const file_meta *meta)
{
	if (!meta)
		return false;

	for (int i = 0; i < TOTAL_GCM_COUNT; i++)
		if (!memcmp(&meta->diskId, nkit_dat[i].header, 6) &&
			meta->diskId.disknum == nkit_dat[i].disknum &&
			meta->diskId.gamever == nkit_dat[i].gamever &&
			(meta->bannerSum == nkit_dat[i].banner.sum || meta->bannerSum == 0xFFFF))
			return !!nkit_dat[i].numdisk;

	if (strcasestr(meta->bannerDesc.gameName, "DISC") ||
		strcasestr(meta->bannerDesc.company, "DISC") ||
		strcasestr(meta->bannerDesc.fullGameName, "DISC") ||
		strcasestr(meta->bannerDesc.fullCompany, "DISC") ||
		strcasestr(meta->bannerDesc.description, "DISC"))
		return true;

	return false;
}

bool is_nkit_format(const DiskHeader *header)
{
	return !memcmp(&header->NKitMagicWord, "NKIT v01", 8);
}

bool is_redump_disc(const file_meta *meta)
{
	if (!meta)
		return false;

	for (int i = 0; i < REDUMP_COUNT; i++)
		if (!memcmp(&meta->diskId, nkit_dat[i].header, 6) &&
			meta->diskId.disknum == nkit_dat[i].disknum &&
			meta->diskId.gamever == nkit_dat[i].gamever &&
			(meta->bannerSum == nkit_dat[i].banner.sum || meta->bannerSum == 0xFFFF))
			return true;

	return false;
}

bool is_streaming_disc(const DiskHeader *header)
{
	if (is_nkit_format(header)) {
		uint8_t header_sum = fletcher8(header, sizeof(*header));

		for (int i = 0; i < TOTAL_GCM_COUNT; i++)
			if (header_sum == nkit_dat[i].header_sum8 &&
				!memcmp(header, nkit_dat[i].header, 6) &&
				header->DiscID == nkit_dat[i].disknum &&
				header->Version == nkit_dat[i].gamever &&
				header->ImageCRC == nkit_dat[i].crc)
				return nkit_dat[i].streaming;
	} else {
		uint16_t header_sum = fletcher16(header, sizeof(*header));

		for (int i = 0; i < TOTAL_GCM_COUNT; i++)
			if (header_sum == nkit_dat[i].header_sum16 &&
				!memcmp(header, nkit_dat[i].header, 6) &&
				header->DiscID == nkit_dat[i].disknum &&
				header->Version == nkit_dat[i].gamever)
				return nkit_dat[i].streaming;
	}

	return needs_audio_buffer((dvddiskid *)header);
}

bool is_verifiable_disc(const DiskHeader *header)
{
	if (is_nkit_format(header))
		return true;

	for (int i = 0; i < TOTAL_GCM_COUNT; i++)
		if (!memcmp(header, nkit_dat[i].header, 6) &&
			header->DiscID == nkit_dat[i].disknum &&
			header->Version == nkit_dat[i].gamever)
			return true;

	return false;
}

bool get_gcm_banner_fast(const DiskHeader *header, uint32_t *offset, uint32_t *size)
{
	*offset = ~0;

	if (is_nkit_format(header)) {
		uint8_t header_sum = fletcher8(header, sizeof(*header));

		for (int i = 0; i < TOTAL_GCM_COUNT; i++) {
			if (header_sum == nkit_dat[i].header_sum8 &&
				!memcmp(header, nkit_dat[i].header, 6) &&
				header->DiscID == nkit_dat[i].disknum &&
				header->Version == nkit_dat[i].gamever &&
				header->ImageCRC == nkit_dat[i].crc &&
				header->ImageSize == nkit_dat[i].size + nkit_dat[i]._size &&
				*size == nkit_dat[i].size) {
				*offset = nkit_dat[i].banner.offset;
				*size = nkit_dat[i].banner.size;
				return true;
			}
		}
	} else {
		uint16_t header_sum = fletcher16(header, sizeof(*header));

		for (int i = 0; i < TOTAL_GCM_COUNT; i++) {
			if (header_sum == nkit_dat[i].header_sum16 &&
				!memcmp(header, nkit_dat[i].header, 6) &&
				header->DiscID == nkit_dat[i].disknum &&
				header->Version == nkit_dat[i].gamever &&
				(*size == nkit_dat[i].size + nkit_dat[i]._size ||
				*size == header->UserPos + header->UserLength)) {

				for (int j = i + 1; j < TOTAL_GCM_COUNT; j++)
					if (nkit_dat[i].header_sum16 == nkit_dat[j].header_sum16 &&
						!memcmp(nkit_dat[i].header, nkit_dat[j].header, 8) &&
						nkit_dat[i].size + nkit_dat[i]._size == nkit_dat[j].size + nkit_dat[j]._size &&
						nkit_dat[i].banner.offset + nkit_dat[i].banner._offset != nkit_dat[j].banner.offset + nkit_dat[j].banner._offset)
						return false;

				*offset = nkit_dat[i].banner.offset + nkit_dat[i].banner._offset;
				*size = nkit_dat[i].banner.size;
				return true;
			}
		}
	}

	return false;
}

uint64_t get_gcm_boot_hash(const DiskHeader *header, const file_meta *meta)
{
	if (is_nkit_format(header)) {
		uint8_t header_sum = fletcher8(header, sizeof(*header));

		for (int i = 0; i < TOTAL_GCM_COUNT; i++)
			if (header_sum == nkit_dat[i].header_sum8 &&
				!memcmp(header, nkit_dat[i].header, 6) &&
				header->DiscID == nkit_dat[i].disknum &&
				header->Version == nkit_dat[i].gamever &&
				header->ImageCRC == nkit_dat[i].crc)
				return nkit_dat[i].boot_hash;
	} else {
		uint16_t header_sum = fletcher16(header, sizeof(*header));

		for (int i = 0; i < TOTAL_GCM_COUNT; i++)
			if (header_sum == nkit_dat[i].header_sum16 &&
				!memcmp(header, nkit_dat[i].header, 6) &&
				header->DiscID == nkit_dat[i].disknum &&
				header->Version == nkit_dat[i].gamever &&
				meta->bannerSum == nkit_dat[i].banner.sum)
				return nkit_dat[i].boot_hash;
	}

	return 0;
}

const char *get_gcm_title(const DiskHeader *header, file_meta *meta)
{
	if (meta->bannerSum == 0xFFFF)
		meta->displayName = strncpy(meta->bannerDesc.fullGameName, header->GameName, BNR_FULL_TEXT_LEN);

	if (is_nkit_format(header)) {
		uint8_t header_sum = fletcher8(header, sizeof(*header));

		for (int i = 0; i < TOTAL_GCM_COUNT; i++) {
			if (header_sum == nkit_dat[i].header_sum8 &&
				!memcmp(header, nkit_dat[i].header, 6) &&
				header->DiscID == nkit_dat[i].disknum &&
				header->Version == nkit_dat[i].gamever &&
				header->ImageCRC == nkit_dat[i].crc) {
				meta->displayName = nkit_dat[i].title;
				return nkit_dat[i].title;
			}
		}
	} else {
		uint16_t header_sum = fletcher16(header, sizeof(*header));

		for (int i = 0; i < TOTAL_GCM_COUNT; i++) {
			if (header_sum == nkit_dat[i].header_sum16 &&
				!memcmp(header, nkit_dat[i].header, 6) &&
				header->DiscID == nkit_dat[i].disknum &&
				header->Version == nkit_dat[i].gamever &&
				meta->bannerSum == nkit_dat[i].banner.sum) {
				meta->displayName = nkit_dat[i].title;
				return nkit_dat[i].title;
			}
		}
	}

	return meta->displayName;
}

int valid_dol_xxh3(const file_handle *file, uint64_t hash)
{
	const char *name = basename(file->name);

	for (int i = 0; i < VALID_DOL_COUNT; i++) {
		if (!strcasecmp(name, file_dat[i].name)) {
			if (file->size == file_dat[i].size &&
				hash == file_dat[i].hash)
				return 1;
			else
				return 0;
		}
	}

	return -1;
}

int valid_file_xxh3(const DiskHeader *header, const ExecutableFile *file)
{
	int valid = -1;

	if (valid_gcm_boot(header) && header->DOLOffset == file->offset) {
		if (is_nkit_format(header)) {
			uint8_t header_sum = fletcher8(header, sizeof(*header));

			for (int i = 0; i < VALID_GCM_COUNT; i++) {
				if (header_sum == nkit_dat[i].header_sum8 &&
					!memcmp(header, nkit_dat[i].header, 6) &&
					header->DiscID == nkit_dat[i].disknum &&
					header->Version == nkit_dat[i].gamever &&
					header->ImageCRC == nkit_dat[i].crc) {
					if (file->hash == nkit_dat[i].boot_hash)
						return 1;

					valid = 0;
				}
			}
		}
	}

	const char *name = basename(file->name);

	if (is_nkit_format(header)) {
		for (int i = 0; i < NKIT_FIRM_COUNT; i++) {
			if (!strcasecmp(name, file_dat[i].name)) {
				if (file->size == file_dat[i].size &&
					file->hash == file_dat[i].hash)
					return 1;

				valid = 0;
			}
		}
	} else {
		for (int i = 0; i < FIRM_COUNT; i++) {
			if (!strcasecmp(name, file_dat[i].name)) {
				if (file->size == file_dat[i].size &&
					file->hash == file_dat[i].hash)
					return 1;

				valid = 0;
			}
		}
	}

	return valid;
}

bool valid_gcm_boot(const DiskHeader *header)
{
	if (!memcmp(header, &DATEL, offsetof(DiskHeader, DVDMagicWord)))
		return false;

	return !!header->DOLOffset;
}

bool valid_gcm_crc32(const DiskHeader *header, uint32_t crc)
{
	if (is_nkit_format(header))
		return header->ImageCRC == crc;

	for (int i = 0; i < VALID_GCM_COUNT; i++)
		if (!memcmp(header, nkit_dat[i].header, 6) &&
			header->DiscID == nkit_dat[i].disknum &&
			header->Version == nkit_dat[i].gamever &&
			crc == nkit_dat[i].crc) return true;

	return false;
}

bool valid_gcm_magic(const DiskHeader *header)
{
	if (!memcmp(header, &NDDEMO, offsetof(DiskHeader, DVDMagicWord)) &&
		!strcmp(header->GameName, "NDDEMO")) return true;

	return header->DVDMagicWord == DVD_MAGIC;
}

bool valid_gcm_size(const DiskHeader *header, off_t size)
{
	if (is_nkit_format(header)) {
		uint8_t header_sum = fletcher8(header, sizeof(*header));

		for (int i = 0; i < VALID_GCM_COUNT; i++)
			if (header_sum == nkit_dat[i].header_sum8 &&
				!memcmp(header, nkit_dat[i].header, 6) &&
				header->DiscID == nkit_dat[i].disknum &&
				header->Version == nkit_dat[i].gamever &&
				header->ImageCRC == nkit_dat[i].crc &&
				header->ImageSize == nkit_dat[i].size + nkit_dat[i]._size &&
				size == nkit_dat[i].size) return true;
	} else {
		uint16_t header_sum = fletcher16(header, sizeof(*header));

		for (int i = 0; i < VALID_GCM_COUNT; i++)
			if (header_sum == nkit_dat[i].header_sum16 &&
				!memcmp(header, nkit_dat[i].header, 6) &&
				header->DiscID == nkit_dat[i].disknum &&
				header->Version == nkit_dat[i].gamever &&
				size == nkit_dat[i].size + nkit_dat[i]._size)
				return true;
	}

	return size == DISC_SIZE;
}

bool valid_gcm_size2(const DiskHeader *header, off_t size)
{
	return size == header->UserPos + header->UserLength;
}

bool needs_audio_buffer(const dvddiskid *diskId)
{
	if (!diskId->streaming)
		return false;

	for (int i = 0; i < TOTAL_GCM_COUNT; i++) {
		if (!memcmp(diskId, nkit_dat[i].header, 6) &&
			diskId->disknum == nkit_dat[i].disknum &&
			diskId->gamever == nkit_dat[i].gamever) {
			bool streaming = nkit_dat[i].streaming;

			for (int j = i + 1; j < TOTAL_GCM_COUNT; j++)
				if (!memcmp(diskId, nkit_dat[j].header, 6) &&
					diskId->disknum == nkit_dat[j].disknum &&
					diskId->gamever == nkit_dat[j].gamever)
					streaming |= nkit_dat[j].streaming;

			return streaming;
		}
	}

	return diskId->streaming;
}

bool needs_flippy_bypass(const file_handle *file, uint64_t hash)
{
	const char *name = basename(file->name);

	for (int i = VALID_DOL_COUNT; i < TOTAL_DOL_COUNT; i++)
		if (!strcasecmp(name, file_dat[i].name) ||
			(file->size == file_dat[i].size &&
			hash == file_dat[i].hash)) return true;

	return false;
}

bool needs_nkit_reencode(const DiskHeader *header, off_t size)
{
	if (!is_nkit_format(header))
		return false;

	uint8_t header_sum = fletcher8(header, sizeof(*header));

	for (int i = VALID_GCM_COUNT; i < TOTAL_GCM_COUNT; i++)
		if (header_sum == nkit_dat[i].header_sum8 &&
			!memcmp(header, nkit_dat[i].header, 6) &&
			header->DiscID == nkit_dat[i].disknum &&
			header->Version == nkit_dat[i].gamever &&
			header->ImageCRC == nkit_dat[i].crc &&
			header->ImageSize == nkit_dat[i].size + nkit_dat[i]._size &&
			size == nkit_dat[i].size) return true;

	return false;
}
